INSERT INTO `class` VALUES (1, '象棋A班', '<p>\r\n\r\n</p><div><h2>适用人群</h2><p>小学生、成年人等对象棋感兴趣的朋友。</p></div><div><h2>课程概述</h2><div>课程通过动画的形式系统介绍中国象棋的入门。<br>学习者能够在零基础的情况下掌握象棋的基础知识。<br>课程内容深入浅出，摒弃了传统的教学方式，采用全新的动画教学方式，排除了教师出境，实物象棋等的干扰信息，能够让学习者全身心投入到象棋的技巧学习上。<br>目前，课程为优惠期，在更新完毕后会修改价格。现在的大部分课程为免费课程，请您在购买前先试看，并请在满意后再购买。</div></div>', '2018-05-01 00:00:00', '2019-05-10 00:00:00', 1, 1, 7, 40, '进行中', '社区');
