INSERT INTO `course` VALUES (1, '学象棋开局-最温柔的五八炮', '', NULL, 8, 2, 0.00);
INSERT INTO `course` VALUES (2, '《中国结入门》基础手工编绳教程', '<p>简介：整个课程是一个新春主题中国结挂件的手工制作过程，包括几个基本结的讲解，以及整个挂件的组装连接。适用做喜欢手工或者想给自己一个特别新春礼物的小伙伴们。 </p>', '37fd815e2f1647bfb6efbc585acba31e.png', 9, 2, 400.00);
INSERT INTO `course` VALUES (3, '中老年广场交谊舞入门', '', NULL, 8, 12, 0.00);
INSERT INTO `course` VALUES (4, '基础少儿街舞视频课程', '', NULL, 8, 10, 0.00);
INSERT INTO `course` VALUES (5, '幼小衔接拼音启蒙班', '', NULL, 8, 20, 0.00);
INSERT INTO `course` VALUES (6, '小朋友学画画系列之一神奇太空', '', NULL, 8, 10, 0.00);
INSERT INTO `course` VALUES (7, '计算机办公软件', '', NULL, 8, 24, 0.00);
INSERT INTO `course` VALUES (8, '零基础学编程系列之C语言入门', '', NULL, 8, 24, 0.00);
INSERT INTO `course` VALUES (9, '午托', '', NULL, 8, 24, NULL);
INSERT INTO `course` VALUES (10, '7+1节课，围棋基础知识的快速入门', '<p>\r\n幼儿园，小学学校课堂围棋教学16年。所教学生获奖难以计数。佼佼者有3个业余5段，3个业余4段。\r\n<br>本教室课程特点：充分注意到小朋友注意力集中时间较短的客观规律，每集一个知识点，简明易懂，讲解练习内容丰富，让小朋友消化吸收掌握每一个知识点。堪称为棋童量身定做的宝典！。\r\n<br>学习建议：初学者家长陪练，尽量输棋让小朋友产生成就感进而提高兴趣。\r\n<br>后续课程:《围棋入门进阶篇》《围棋初级篇》《围棋实战思维》正在制作中,敬请关注。\r\n<br>课程简介：\r\n<br>第一章\r\n<br>入门篇：\r\n<br>第一课： 围棋的基本规则\r\n<br>第二课：数气\r\n<br>第三课：“接触战”中的“紧气与长气”\r\n<br>第四课：虎口，禁着点，打劫\r\n<br>第五课：连接与切断\r\n<br>第六课：死活之两眼活棋\r\n<br>第七课：地盘的概念\r\n<br>第八课：下完一盘棋（教师示范）\r\n<br>本课程入门8节课免费。\r\n\r\n\r\n</p>', '33ef6656df3e4d2ab5d5dcf269633780.jpeg', 8, 4, 0.00);
INSERT INTO `course` VALUES (11, '2', '', NULL, 11, 3, NULL);
INSERT INTO `course` VALUES (12, '玩转10种魔方，练就最强大脑', '<p>适用人群<br>1、5岁以上青少年或各年龄魔方爱好者。<br>2、专注力差、注意力不集中者。<br>3、希望开发智力、提升空间思维者。<br><br>课程概述<br>1、最权威专业的魔方手法教学；<br>2、标准魔方解法，可持续进阶至世界级魔方高手；<br>3、独家传授最有效的魔方提速方法；<br>4、十种常见正阶魔方及异形魔方全部搞定；<br>5、最佳视角拍摄，与学员视角一致，轻松理解；<br>6、全程字幕+实景教学+PPT演示，易学易懂。<br></p><p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"><br></p>', 'a1828857ba6b487a8cc679a9534ede17.jpeg', 8, 10, 50.00);
INSERT INTO `course` VALUES (13, '学象棋开局-最', '', NULL, 8, 7, 8.00);
