DROP TABLE IF EXISTS `notify`;
CREATE TABLE `notify`  (
  `nid` int(11) NOT NULL AUTO_INCREMENT COMMENT '消息主键',
  `ntheme` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '消息主题',
  `ncontent` longtext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '消息内容',
  `ntype` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '消息类别',
  `nimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '消息图片',
